using namespace std;

#define MOD 1000000007

class Solution {
   private:
    bool debug;

    vector<int> createSortedVec(vector<int>& vec) {
        vector<int> sortedVec(vec);
        sort(sortedVec.begin(), sortedVec.end());
        return sortedVec;
    }

    pair<int, priority_queue<pair<int, int>>> createDiffHeap(vector<int>& vec1, vector<int>& vec2) {
        int diffSum = 0;

        priority_queue<pair<int, int>> heap;
        for (int i = 0; i < vec1.size(); i++) {
            int diff = abs(vec1[i] - vec2[i]);
            if (diff == 0) {
                continue;
            }

            diffSum += diff;
            diffSum %= MOD;

            heap.push({diff, i});
        }

        return {diffSum, heap};
    }

    int findAbsDiff(int n1, int n2) {
        if (n1 == n2) {
            return 0;
        }

        if ((max(n1, n2) == INT_MAX) || (min(n1, n2) == INT_MIN)) {
            return INT_MAX;
        }

        return abs(n1 - n2);
    }

    int findClosestEle(vector<int>& vec, int lo, int hi, int ele) {
        int len = hi - lo + 1;
        if (len <= 0) {
            return INT_MAX;
        }

        int mid = (lo + hi) / 2;
        int midEle = vec[mid];
        int midDiff = findAbsDiff(ele, midEle);

        if (ele < midEle) {
            int leftAns = findClosestEle(vec, lo, mid - 1, ele);
            int leftDiff = findAbsDiff(ele, leftAns);
            return (leftDiff < midDiff) ? leftAns : midEle;
        } else if (ele == midEle) {
            return midEle;
        } else {
            int rightAns = findClosestEle(vec, mid + 1, hi, ele);
            int rightDiff = findAbsDiff(ele, rightAns);
            return (rightDiff < midDiff) ? rightAns : midEle;
        }
    }

    int findMaxGain(
        vector<int>& nums1,
        vector<int>& nums2,
        priority_queue<pair<int, int>>& diffHeap) {
        int len = nums1.size();
        if (len <= 0) {
            return 0;
        }

        vector<int> sortedNums1 = createSortedVec(nums1);

        int dipMax = INT_MIN;
        int dipMaxIdx = -1;
        int iter = 0;
        while (!diffHeap.empty() && ((dipMax == INT_MIN) || (diffHeap.top().first > dipMax))) {
            int orgDiff = diffHeap.top().first;
            int idx = diffHeap.top().second;
            diffHeap.pop();

            int val1 = nums1[idx];
            int val2 = nums2[idx];

            // find element closest to val2 in nums1
            int closestEle = findClosestEle(sortedNums1, 0, len - 1, val2);
            if (closestEle == val2) {
                // same element found -> entire existing difference can be shaved off
                return orgDiff;
            }

            // find gain made by replacing val2 with closestEle
            int reducedDiff = findAbsDiff(closestEle, val2);
            int gain = orgDiff - reducedDiff;
            if ((gain > 0) && (gain > dipMax)) {
                dipMax = gain;
                dipMaxIdx = idx;
            }

            iter++;
        }

        return max(dipMax, 0);
    }

   public:
    friend class SolutionTest;
    int minAbsoluteSumDiff(vector<int>& nums1, vector<int>& nums2) {
        int len = nums1.size();
        if (len == 0) {
            return 0;
        }

        pair<int, priority_queue<pair<int, int>>> diffsResponse = createDiffHeap(nums1, nums2);
        int orgDiffSum = diffsResponse.first;
        priority_queue<pair<int, int>> diffHeap = diffsResponse.second;

        if ((len == 1) || (orgDiffSum == 0)) {
            return orgDiffSum;
        }

        int dipMax = findMaxGain(nums1, nums2, diffHeap);
        int reducedDiffSum = (orgDiffSum - dipMax) % MOD;

        return reducedDiffSum;
    }
};

